                                    </Col>
                                    <Col span={10}></Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'customer'}
                                            label="Customer"
                                            labelCol={{span: 7, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'field_engineer_days'}
                                            label="Field engineer (Days)"
                                            labelCol={{span: 10, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'well'}
                                            label="Well"
                                            labelCol={{span: 7, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'field_engineer_nights'}
                                            label="Field engineer (Nights)"
                                            labelCol={{span: 10, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'stage'}
                                            label="Stage"
                                            labelCol={{span: 7, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'plug_type'}
                                            label="Plug type"
                                            labelCol={{span: 10, offset: 0}}
                                            labelAlign="left"
